import React from 'react'
import PropTypes from 'prop-types'
import CustomImage from '../CustomImage'

const NavabarDropdown = ({onclick}) => {
    console.log("first",onclick)
  return (
    <div className='bg-white flex px-5 py-2 flex-col' onClick={onclick}>

        <div>
            <CustomImage name="userIcon" />
        </div>
        User

    </div>
  )
}

NavabarDropdown.propTypes = {
    onclick: PropTypes.func.isRequired,
}

export default NavabarDropdown
